// src/components/Header.js
import React from 'react';
import { NavLink } from 'react-router-dom';

function Header() {
  return (
    <header>
      <h1>HRMS Dashboard</h1>
      <nav>
        <NavLink to="/employees">Employees</NavLink>
        <NavLink to="/teams">Teams</NavLink>
      </nav>
    </header>
  );
}

export default Header;
